  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1945. The report begins by summarizing the weather conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments and wildfires. Resource management is outlined; topics include
  haying and fur harvesting. The public relations section of the report describes
  recreational uses, Refuge visitors, hunting, and violations. A short narrative report
  of North Platte National Wildlife Refuge is attached, as well as some N-R forms.\",\n\t\"owner_org\":
